import React from 'react'

const BotList = ({names, setNames}) => {
  return (
    <div>
      {names.map((name) => (
        <li className='list-' key={name.id}>
            <p className='list-item'>{name.title}

            </p>
        </li>
        )
      )}
    </div>
  )
}


export default BotList
